Usted nunca se va a poner en contra de su prima Lina Moreno de Uribe, la esposa del #Matarife, al contrario apoyará a cualquier títere porque el que sigue es usted, seguramente también compraran votos a $50.000 y por eso legítima al #NarcoPresidente 
@IvanDuque
 y su #NarcoEstado

Imagínate tú ser un tuitero petrista y estar todo el día esperando que 
@sergio_fajardo
