Voté por ti porque eras del grupo del "todo no se vale" y de la decencia. Cómo es posible que digas que un gobierno que llega por medio del narcotráfico y compra de votos es legítimo? Por cosas cómo esta quisiera mejor que 
@CamiloRomero
 fuera la fórmula del Partido Verde.
